const doLoadMovies = (movies) => {
    return {
      type: 'LOADMOVIE',
      payload: movies,
    };
  };

const doEditMovies = (movie) => {
    return {
      type: 'EDITMOVIE',
      payload: movie,
    };
  };


  export  { doLoadMovies, doEditMovies }
